import React from 'react';
import AboutCom from '../components/about-page/AboutCom';
import './style.css';

function About(props) {
  return (
    <>
      <div className="title-page-about">
        <h1>About</h1>
      </div>
      <AboutCom title="WHO WE " />
    </>
  );
}

export default About;
